(+) Открытый, честный и прямой человек, люблю общаться с новыми людьми; командный игрок - всегда приду на выручку; умею слушать, все задуманное довожу до своего логического завершения; много читаю, как художественную, так и профессиональную литературу; внимателен к мелочам;
(-) Немного застенчивый, вспыльчивый, самоуверенный, своенравный, люблю поспорить и настоять на своем;

А вообще я люблю жизнь, семью, природу, путешествия и музыку. Иногда пишу стихи...
